import configparser
import time
import threading
import os
import base64
from io import BytesIO
from pypresence import Presence
from PIL import Image, ImageDraw
from pystray import MenuItem, Icon
import webbrowser

config_file_path = 'config.ini'

config = configparser.ConfigParser()

if not os.path.isfile(config_file_path):
    config['RichPresence'] = {
        '#create Client id for application':'https://discord.com/developers/applications',
        'client_id': 'YOUR_CLIENT_ID',
        'state': 'Your State',
        'details': 'Your Details',
        '# Set to 1 to enable starting time': '', 
        'start': '1', 
        'large_image': 'your_large_image',
        'large_text': 'Your Large Text',
        'small_image': 'your_small_image',
        'small_text': 'Your Small Text',
        'button1_label': 'Button 1',
        'button1_url': 'https://example.com',
        'button2_label': 'Button 2',
        'button2_url': 'https://example.com',
        'tray_icon_base64': ''
    }

    with open(config_file_path, 'w') as configfile:
        config.write(configfile)
    print(f"Config file '{config_file_path}' created with default values.")

config.read(config_file_path)

CLIENT_ID = config['RichPresence'].get('client_id', '')
STATE = config['RichPresence'].get('state', '')
DETAILS = config['RichPresence'].get('details', '')
START_ENABLED = config['RichPresence'].getint('start', 1) == 1
LARGE_IMAGE = config['RichPresence'].get('large_image', '')
LARGE_TEXT = config['RichPresence'].get('large_text', '')
SMALL_IMAGE = config['RichPresence'].get('small_image', '')
SMALL_TEXT = config['RichPresence'].get('small_text', '')
BUTTON1_LABEL = config['RichPresence'].get('button1_label', '')
BUTTON1_URL = config['RichPresence'].get('button1_url', '')
BUTTON2_LABEL = config['RichPresence'].get('button2_label', '')
BUTTON2_URL = config['RichPresence'].get('button2_url', '')
TRAY_ICON_BASE64 = config['RichPresence'].get('tray_icon_base64', '')

rpc = Presence(CLIENT_ID)
rpc.connect()

update_args = {}

if STATE:
    update_args["state"] = STATE
if DETAILS:
    update_args["details"] = DETAILS
if LARGE_IMAGE:
    update_args["large_image"] = LARGE_IMAGE
if SMALL_IMAGE:
    update_args["small_image"] = SMALL_IMAGE
if LARGE_TEXT:
    update_args["large_text"] = LARGE_TEXT
if SMALL_TEXT:
    update_args["small_text"] = SMALL_TEXT

buttons = []
if BUTTON1_LABEL:
    buttons.append({"label": BUTTON1_LABEL, "url": BUTTON1_URL})
if BUTTON2_LABEL:
    buttons.append({"label": BUTTON2_LABEL, "url": BUTTON2_URL})
if buttons:
    update_args["buttons"] = buttons

if START_ENABLED:
    update_args["start"] = time.time()

rpc.update(**update_args)
print("Rich Presence aktiviert!")

def load_icon_from_base64(base64_string):
    image_data = base64.b64decode(base64_string)
    image = Image.open(BytesIO(image_data))
    return image

def on_exit(icon, item):
    icon.stop()
    print("Rich Presence beendet.")
    rpc.close()
    os._exit(0)

# Function to open URL
def open_url(url):
    webbrowser.open(url)

def app_id():
    open_url("https://discord.com/developers/applications")

def github_link():
    open_url("https://github.com/deepCodeloverBoy/Py-DRPS")

menu = (MenuItem("Github", github_link),
        MenuItem("create ID", app_id),
        MenuItem("Exit program", on_exit),
        MenuItem("Presence program by Drazzild", action=None, enabled=False),)

def setup(icon):
    icon.visible = True

if TRAY_ICON_BASE64:
    tray_icon_image = load_icon_from_base64(TRAY_ICON_BASE64)
else:
    tray_icon_image = Image.new('RGB', (64, 64), (255, 255, 255))
    draw = ImageDraw.Draw(tray_icon_image)
    draw.ellipse((0, 0, 64, 64), fill=(0, 0, 0))

icon = Icon("test_icon", tray_icon_image, "Rich Presence", menu)
threading.Thread(target=icon.run, daemon=True).start()

try:
    while True:
        time.sleep(15)
except KeyboardInterrupt:
    print("Rich Presence beendet.")
    icon.stop()
    os._exit(0)
